schema\u0004Note: To disable a context m:
注意：要禁用上下文菜单项，
将其复制到用户首选项并添加「禁用」键。
下面的示例将在文件上禁用下载项：
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

上下文菜单描述：

schema\u0004Note: To disable a menu or a:
注意：要禁用一个菜单或一个菜单项，
将其复制到用户选项并添加「禁用」键。
下面的示例将禁用「标签页」、「重启内核」以及「运行到所选单元格」项：
{
  "menus": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

